import "./App.css";

function App() {
  return (
    <div>
      <header>
        <img src="https://86.img.avito.st/208x156/11621659786.jpg"></img>
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>
    </div>
  );
}

export default App;
